import React from "react";
import {NavLink} from "react-router-dom";

const SignedInLinks = () => {
    
    return (<div>
            <li className="nav-item"><NavLink to='/' className="nav-link">New Project</NavLink></li>
            <li className="nav-item"><NavLink to='/' className="nav-link">Log Out </NavLink></li>
            <li className="nav-item"><NavLink to='/' className="btn btn-primary"> NN </NavLink></li>
            </div>
    )
}

export default SignedInLinks;
